import React from "react";

function Circle() {
  return (
    <svg
      width=".8em"
      height=".8em"
      viewBox="0 0 16 16"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <circle cx="8" cy="8" r="8" fill="#000000" />
    </svg>
  );
}

export default Circle;
